import {Outlet} from 'react-router-dom';

import Subnavigation from '../layouts/subnavigation'
import SubnavItem from '../layouts/subnavitem'

import styled from 'styled-components'
import '../styles/theme.css'

const Dashboards = () => (
  <StyledContainer>
    <Subnavigation title='Dashboards'>
      <SubnavItem to='/dashboards/all'>All</SubnavItem>
      <SubnavItem to='/dashboards/saved1'>Dash1</SubnavItem>
      <SubnavItem to='/dashboards/saved2'>Dash2</SubnavItem>
    </Subnavigation>
    <Outlet/>
  </StyledContainer>
);

const StyledContainer = styled('div')`
  display: grid;
  grid-template-columns: 200px auto;
`;

export default Dashboards;
